import 'bootstrap/dist/css/bootstrap.min.css';
// import Login from '../LoginComponent/login';
import {Component} from 'react';
import './signup.css'

class SignUp extends Component{
    constructor(props){
        super(props);
        this.state={
            role: '',
            email : '',
            userName : '',
            phoneNumber : '',
            password : '',
            data : []
        };
    }
    InputChange=(e)=>{
        this.setState({
            [e.target.name] : [e.target.value]
        });
    }
    SubmitData=(e)=>{
        e.preventDefault();

        const {role,email,userName,phoneNumber,password} = this.state;
        const data ={
            role,
            email,
            userName,
            phoneNumber,
            password
        };

        fetch('http://localhost:3333/realestate/signup',{
            method: 'POST',
            headers:{
                'content-type': 'application/json'
            },
            body: JSON.stringify(data)
        })
    }

    render(){
        return (
            <div className='register my-5'>
                <form className='position-absolute end-0 mx-4'>
                    <div className='mx-5' id='radio'>
                        <input className='mx-3' type='radio' name='role' value='Buyer'></input>
                        <label>Buyer</label>
                        <span className='mx-5'>
                            <input className='mx-3' type='radio' name='role' value='Seller'></input>
                            <label>Seller</label>
                        </span>
                    </div>
                    <div className='form-floating my-2'>
                        <input className='form-control rounded-pill' name='email' placeholder='example@gmail.com'></input>
                        <label className='px-3'>Email address</label>
                    </div>
                    <div className='form-floating my-2'>
                        <input className='form-control rounded-pill' name='userName' placeholder='username'></input>
                        <label className='px-3'>User name</label>
                    </div>
                    <div className='form-floating my-2'>
                        <input className='form-control rounded-pill' name='phoneNumber' placeholder='phonenumber'></input>
                        <label className='px-3'>Phone number</label>
                    </div>
                    <div className="form-floating my-2">
                        <input type="password" className="form-control rounded-pill" name='password' placeholder="password"></input>
                        <label className='px-3'>Password</label>
                    </div>
                    <div className='row my-2 px-3'>
                        <button className='btn btn-primary rounded-4 my-2' type='Submit'>Submit</button>
                        <button className='btn btn-outline-primary rounded-4'>Login</button>
                        {/* <Login/> */}
                    </div>
                </form>
            </div>
        );
    }

}

export default SignUp;
